import { useState, useEffect } from "react";
import client from "../client";

export default function Blog() {
  const [posts, setposts] = useState([]);

  useEffect(() => {
    client
      .fetch(
        `*[_type == "post"] {
        title,
        slug,
        body,
        mainImage {
          asset -> {
            _id,url
          },
          alt
        }
      }`
      )
      .then((data) => setposts(data))
      .catch(console.error);
  }, []);
  return (
    <>
      <section>
        <h1>blog page</h1>
        <h2>You are viewing {posts.lenght} blog post</h2>
      </section>
    </>
  );
}
